import React from 'react';
import './app.css'
import Navbar from "./navbar/Navbar";

function App() {
    return (
        <div className="app">
            <Navbar/>
            <Router>
                <Navbar />
                <Routes>
                    <Route path="/" element={<Home />} />
                    <Route path="/about" element={<About />} />
                    <Route path="/contact" element={<Contact />} />
                </Routes>
            </Router>
        </div>
    );
}

export default App;
